(function ($) {		
	$.multicolselect = function(el, options) {
        // Private Functions
        function emptyArray(a){
 	       while(a.length) { a.pop(); }	
        }
        
        
        
		function initEvents(){
			$buscador.keyup(search);
			$labels.click(toggleDroppableVisibility);
			$multicol.find("#selectAll").click(selectAll);
			$multicol.find("#selectFiltered").click(selectFiltered);
			$multicol.find("#deselectAll").click(deselectAll);
		}
			
		function addCheckboxEvents(){
			$multicol.find(":checkbox").click(onSelectItem);
		}
		
		function setInputValue(){
			base.$el.val(selectedItems.join());
			$itemsSelectedSpan.text(selectedItems.length);
		}
			
		function toggleDroppableVisibility() {
		    if ($droppable.css("display") === "none") {
		        $droppable.show();
		        //$("body").bind("click", function (e) { toggleDroppableVisibility(); });
		    }
		    else {
		        $droppable.hide();
		        //$("body").unbind("click");
		    }
		}
	
		
		function search(){
			var searchTerm = $buscador.val().toLowerCase();
			var applySearch = (searchTerm !== "");
			var ok = "";
			var ko = "";
			
			var searchRegExp = new RegExp(searchTerm, "i");
			
			for(var i=0; i<data.length; i++){
				var item = data[i];
				var label = item.label;
				var value = item.value;
				var checked = (selectedItems.indexOf(value) != -1)? "checked" : "";
	
				var itemHtml = buildItem(label, value, checked);
				if (applySearch && label.search(searchRegExp) != -1){
					ok += itemHtml;
				}
				else{
					ko += itemHtml;
				}
			}
			
			$filteredItemsDiv.html(ok);
			$unfilteredItemsDiv.html(ko);
			
			setInputValue();
		}
		
		
		function buildItem(itemLabel, itemValue, itemChecked){
			var itemHtml = 
				"<div class='multiselectitem'>"
					+ "<input type='checkbox' value='" + itemValue + "' " + itemChecked + " onclick='onSelectItem(this);'/>"
					+ "<span>" + itemLabel + "</span>"
				+ "</div>";
			
			return itemHtml;
		}
		
		
		function onSelectItem(){
			var itemValue = $(this).val();
			
			if ($(this).is(":checked")){
				selectedItems.push(itemValue);
			}
			else{
				var itemPosition = selectedItems.indexOf(itemValue);
				selectedItems.splice(itemPosition, 1);
			}
			setInputValue();
		}
		
		
		function selectAll(){
			$multicol.find("input:checkbox").prop("checked", true);
			emptyArray(selectedItems);
			
			for(var i=0; i<data.length; i++){
				var value = data[i].value;
				if (selectedItems.indexOf(value) == -1){
					selectedItems.push(value);
				}
			}
			setInputValue();
		}
	
		
		function deselectAll(){
			$multicol.find("input:checkbox").prop("checked", false);
			emptyArray(selectedItems);
			setInputValue();
		}
	
		
		function selectFiltered(){
			var $checkedItems = $filteredItemsDiv.find("input:checkbox");
			
			$checkedItems.prop("checked", true);
			
			for(var i=0; i<$checkedItems.length; i++){
				var value = $checkedItems[i].value;
				if (selectedItems.indexOf(value) == -1){
					selectedItems.push(value);
				}
			}
			setInputValue();
		}       
	
	
        // Global Private Variables
		var base = this;
 
        base.$el = $(el);
        base.$el.data('multicolselect', base);
        
        base.el = el;
        
 
		var selectedItems = [];
		
		var $droppable;
		var $filteredItemsDiv;
		var $unfilteredItemsDiv;
		var $buscador;
		
		var $multicol;
		var $labels;
		var $itemsSelectedSpan;
        
 
 
 
        base.init = function(){
			$multicol = 
				$("<div class='select multiselectmulticolumn'>"
					+ "<div class='labels'><span id='itemsSelectedSpan'>0</span> elementos seleccionados</div>"
					+ "<div class='droppable'>"
						+ "<div class='buscadorDiv'>"
							+ "<input type='text' id='buscador' class='buscador' />"
							+ "<input type='button' id='selectAll' value='Seleccionar todo'/>"
							+ "<input type='button' id='selectFiltered' value='Seleccionar la bsqueda'/>"
							+ "<input type='button' id='deselectAll' value='Deseleccionar todo'/>"
						+ "</div>"
						+ "<div class='items'>"
							+ "<div id='filteredItems' class='filteredItems'></div>"
							+ "<div id='unfilteredItems' class='unfilteredItems'></div>"
						+ "</div>"
					+ "</div>"
				+ "</div>");
			
			$multicol.insertAfter(base.$el);
			
			
			$unfilteredItemsDiv = $multicol.find("#unfilteredItems");
			$filteredItemsDiv = $multicol.find("#filteredItems");
			$droppable = $multicol.find(".droppable");
			$buscador = $multicol.find("#buscador");
			$labels = $multicol.find(".labels");
			$itemsSelectedSpan = $labels.find("#itemsSelectedSpan");
			
			search();
			
			initEvents();
        };
 
        base.init();
    };
	
	
	
	
	$.multicolselect.defaultOptions = {

    };

	
	
	
	
	
	$.fn.multicolselect = function(options) {
		return this.each(function(){
            var bp = new $.multicolselect(this, options);
        });
	}		
})(jQuery);